put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/ImageDocument.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/ImageDocument.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is:\u000a * dom/html/public/nsIImageDocument.idl\u000a */\u000a\u000ainterface imgIRequest;\u000a\u000a[ChromeOnly, OverrideBuiltins]\u000ainterface ImageDocument : HTMLDocument {\u000a  /* Whether the image is overflowing visible area. */\u000a  readonly attribute boolean imageIsOverflowing;\u000a\u000a  /* Whether the image has been resized to fit visible area. */\u000a  readonly attribute boolean imageIsResized;\u000a\u000a  /* The image request being displayed in the content area */\u000a  [Throws]\u000a  readonly attribute imgIRequest? imageRequest;\u000a\u000a  /* Resize the image to fit visible area. */\u000a  void shrinkToFit();\u000a\u000a  /* Restore image original size. */\u000a  void restoreImage();\u000a\u000a  /* Restore the image, trying to keep a certain pixel in the same position.\u000a   * The coordinate system is that of the shrunken image.\u000a   */\u000a  void restoreImageTo(long x, long y);\u000a\u000a  /* A helper method for switching between states.\u000a   * The switching logic is as follows. If the image has been resized\u000a   * restore image original size, otherwise if the image is overflowing\u000a   * current visible area resize the image to fit the area.\u000a   */\u000a  void toggleImageSize();\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/InputEvent.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/InputEvent.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a */\u000a\u000a[Constructor(DOMString type, optional InputEventInit eventInitDict)]\u000ainterface InputEvent : UIEvent\u000a{\u000a  readonly attribute boolean       isComposing;\u000a};\u000a\u000adictionary InputEventInit : UIEventInit\u000a{\u000a  boolean isComposing = false;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/InspectorUtils.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/InspectorUtils.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a */\u000adictionary InspectorRGBTriple {\u000a  /*\u000a   * NOTE: Using octet for RGB components is not generally OK, because\u000a   * they can be outside the 0-255 range, but for backwards-compatible\u000a   * named colors (which is what we use this dictionary for) the 0-255\u000a   * assumption is fine.\u000a   */\u000a  octet r = 0;\u000a  octet g = 0;\u000a  octet b = 0;\u000a};\u000a\u000adictionary InspectorRGBATuple {\u000a  /*\u000a   * NOTE: This tuple is in the normal 0-255-sized RGB space but can be\u000a   * fractional and may extend outside the 0-255 range.\u000a   *\u000a   * a is in the range 0 - 1.\u000a   */\u000a  double r = 0;\u000a  double g = 0;\u000a  double b = 0;\u000a  double a = 1;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/InstallTrigger.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/InstallTrigger.webidl"},contents:"/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a */\u000a\u000a\u000a/**\u000a * A callback function that webpages can implement to be notified when triggered\u000a * installs complete.\u000a */\u000acallback InstallTriggerCallback = void(DOMString url, short status);\u000a\u000adictionary InstallTriggerData {\u000a  DOMString URL;\u000a  DOMString? IconURL;\u000a  DOMString? Hash;\u000a};\u000a\u000a/**\u000a * The interface for the InstallTrigger object available to all websites.\u000a */\u000a[ChromeOnly,\u000a JSImplementation=\"@mozilla.org/addons/installtrigger;1\"]\u000ainterface InstallTriggerImpl {\u000a  /**\u000a   * Retained for backwards compatibility.\u000a   */\u000a  const unsigned short SKIN = 1;\u000a  const unsigned short LOCALE = 2;\u000a  const unsigned short CONTENT = 4;\u000a  const unsigned short PACKAGE = 7;\u000a\u000a  /**\u000a   * Tests if installation is enabled.\u000a   */\u000a  boolean enabled();\u000a\u000a  /**\u000a   * Tests if installation is enabled.\u000a   *\u000a   * @deprecated Use \"enabled\" in the future.\u000a   */\u000a  boolean updateEnabled();\u000a\u000a  /**\u000a   * Starts a new installation of a set of add-ons.\u000a   *\u000a   * @param  aArgs\u000a   *         The add-ons to install. This should be a JS object, each property\u000a   *         is the name of an add-on to be installed. The value of the\u000a   *         property should either be a string URL, or an object with the\u000a   *         following properties:\u000a   *          * URL for the add-on's URL\u000a   *          * IconURL for an icon for the add-on\u000a   *          * Hash for a hash of the add-on\u000a   * @param  aCallback\u000a   *         A callback to call as each installation succeeds or fails\u000a   * @return true if the installations were successfully started\u000a   */\u000a  boolean install(record<DOMString, (DOMString or InstallTriggerData)> installs,\u000a                  optional InstallTriggerCallback callback);\u000a\u000a  /**\u000a   * Starts installing a new add-on.\u000a   *\u000a   * @deprecated use \"install\" in the future.\u000a   *\u000a   * @param  aType\u000a   *         Unused, retained for backwards compatibility\u000a   * @param  aUrl\u000a   *         The URL of the add-on\u000a   * @param  aSkin\u000a   *         Unused, retained for backwards compatibility\u000a   * @return true if the installation was successfully started\u000a   */\u000a  boolean installChrome(unsigned short type, DOMString url, DOMString skin);\u000a\u000a  /**\u000a   * Starts installing a new add-on.\u000a   *\u000a   * @deprecated use \"install\" in the future.\u000a   *\u000a   * @param  aUrl\u000a   *         The URL of the add-on\u000a   * @param  aFlags\u000a   *         Unused, retained for backwards compatibility\u000a   * @return true if the installation was successfully started\u000a   */\u000a  boolean startSoftwareUpdate(DOMString url, optional unsigned short flags);\u000a};\u000a"}));
