put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PrecompiledScript.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PrecompiledScript.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a */\u000a\u000a/**\u000a * Represents a pre-compiled JS script, which can be repeatedly executed in\u000a * different globals without being re-parsed.\u000a */\u000a[ChromeOnly, Exposed=(Window,System)]\u000ainterface PrecompiledScript {\u000a  /**\u000a   * Executes the script in the context of, and with the security principal\u000a   * of, the given object's global. If compiled with a return value, returns\u000a   * the value of the script's last expression. Otherwise returns undefined.\u000a   */\u000a  [Throws]\u000a  any executeInGlobal(object global);\u000a\u000a  /**\u000a   * The URL that the script was loaded from.\u000a   */\u000a  [Pure]\u000a  readonly attribute DOMString url;\u000a\u000a  /**\u000a   * True if the script was compiled with a return value, and will return the\u000a   * value of its last expression when executed.\u000a   */\u000a  [Pure]\u000a  readonly attribute boolean hasReturnValue;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/Presentation.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/Presentation.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentation\u000a */\u000a\u000a[Pref=\"dom.presentation.enabled\"]\u000ainterface Presentation {\u000a /*\u000a  * This should be used by the UA as the default presentation request for the\u000a  * controller. When the UA wishes to initiate a PresentationConnection on the\u000a  * controller's behalf, it MUST start a presentation connection using the default\u000a  * presentation request (as if the controller had called |defaultRequest.start()|).\u000a  *\u000a  * Only used by controlling browsing context (senders).\u000a  */\u000a  [Pref=\"dom.presentation.controller.enabled\"]\u000a  attribute PresentationRequest? defaultRequest;\u000a\u000a  /*\u000a   * This should be available on the receiving browsing context in order to\u000a   * access the controlling browsing context and communicate with them.\u000a   */\u000a  [SameObject,\u000a   Pref=\"dom.presentation.receiver.enabled\"]\u000a  readonly attribute PresentationReceiver? receiver;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationAvailability.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationAvailability.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationavailability\u000a */\u000a\u000a[Pref=\"dom.presentation.controller.enabled\"]\u000ainterface PresentationAvailability : EventTarget {\u000a  /*\u000a   * If there is at least one device discovered by UA, the value is |true|.\u000a   * Otherwise, its value should be |false|.\u000a   */\u000a  readonly attribute boolean value;\u000a\u000a  /*\u000a   * It is called when device availability changes.\u000a   */\u000a  attribute EventHandler onchange;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationConnection.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationConnection.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationconnection\u000a */\u000a\u000aenum PresentationConnectionState\u000a{\u000a  // The initial state when a PresentationConnection is ceated.\u000a  \"connecting\",\u000a\u000a  // Existing presentation, and the communication channel is active.\u000a  \"connected\",\u000a\u000a  // Existing presentation, but the communication channel is inactive.\u000a  \"closed\",\u000a\u000a  // The presentation is nonexistent anymore. It could be terminated manually,\u000a  // or either controlling or receiving browsing context is no longer available.\u000a  \"terminated\"\u000a};\u000a\u000aenum PresentationConnectionBinaryType\u000a{\u000a  \"blob\",\u000a  \"arraybuffer\"\u000a};\u000a\u000a[Pref=\"dom.presentation.enabled\"]\u000ainterface PresentationConnection : EventTarget {\u000a  /*\u000a   * Unique id for all existing connections.\u000a   */\u000a  [Constant]\u000a  readonly attribute DOMString id;\u000a\u000a  /*\u000a   * Specifies the connection's presentation URL.\u000a   */\u000a  readonly attribute DOMString url;\u000a\u000a  /*\u000a   * @value \"connected\", \"closed\", or \"terminated\".\u000a   */\u000a  readonly attribute PresentationConnectionState state;\u000a\u000a  attribute EventHandler onconnect;\u000a  attribute EventHandler onclose;\u000a  attribute EventHandler onterminate;\u000a  attribute PresentationConnectionBinaryType binaryType;\u000a\u000a  /*\u000a   * After a communication channel has been established between the controlling\u000a   * and receiving context, this function is called to send message out, and the\u000a   * event handler \"onmessage\" will be invoked at the remote side.\u000a   *\u000a   * This function only works when the state is \"connected\".\u000a   */\u000a  [Throws]\u000a  void send(DOMString data);\u000a\u000a  [Throws]\u000a  void send(Blob data);\u000a\u000a  [Throws]\u000a  void send(ArrayBuffer data);\u000a\u000a  [Throws]\u000a  void send(ArrayBufferView data);\u000a\u000a  /*\u000a   * It is triggered when receiving messages.\u000a   */\u000a  attribute EventHandler onmessage;\u000a\u000a  /*\u000a   * Both the controlling and receiving browsing context can close the\u000a   * connection. Then the connection state should turn into \"closed\".\u000a   *\u000a   * This function only works when the state is \"connected\" or \"connecting\".\u000a   */\u000a  [Throws]\u000a  void close();\u000a\u000a  /*\u000a   * Both the controlling and receiving browsing context can terminate the\u000a   * connection. Then the connection state should turn into \"terminated\".\u000a   *\u000a   * This function only works when the state is not \"connected\".\u000a   */\u000a   [Throws]\u000a   void terminate();\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationConnectionAvailableEvent.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationConnectionAvailableEvent.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationconnectionavailableevent\u000a */\u000a\u000a[Constructor(DOMString type,\u000a             PresentationConnectionAvailableEventInit eventInitDict),\u000a Pref=\"dom.presentation.enabled\"]\u000ainterface PresentationConnectionAvailableEvent : Event\u000a{\u000a  [SameObject]\u000a  readonly attribute PresentationConnection connection;\u000a};\u000a\u000adictionary PresentationConnectionAvailableEventInit : EventInit\u000a{\u000a  required PresentationConnection connection;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationConnectionCloseEvent.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationConnectionCloseEvent.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationconnectioncloseevent\u000a */\u000a\u000aenum PresentationConnectionClosedReason\u000a{\u000a  // The communication encountered an unrecoverable error.\u000a  \"error\",\u000a\u000a  // |PresentationConnection.close()| is called by controlling browsing context\u000a  // or the receiving browsing context.\u000a  \"closed\",\u000a\u000a  // The connection is closed because the destination browsing context\u000a  // that owned the connection navigated or was discarded.\u000a  \"wentaway\"\u000a};\u000a\u000a[Constructor(DOMString type,\u000a             PresentationConnectionCloseEventInit eventInitDict),\u000a Pref=\"dom.presentation.enabled\"]\u000ainterface PresentationConnectionCloseEvent : Event\u000a{\u000a  readonly attribute PresentationConnectionClosedReason reason;\u000a\u000a  // The message is a human readable description of\u000a  // how the communication channel encountered an error.\u000a  // It is empty when the closed reason is closed or wentaway.\u000a  readonly attribute DOMString message;\u000a};\u000a\u000adictionary PresentationConnectionCloseEventInit : EventInit\u000a{\u000a  required PresentationConnectionClosedReason reason;\u000a  DOMString message = \"\";\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationConnectionList.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationConnectionList.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationconnectionlist\u000a */\u000a\u000a[Pref=\"dom.presentation.receiver.enabled\"]\u000ainterface PresentationConnectionList : EventTarget {\u000a  /*\u000a   * Return the non-terminated set of presentation connections in the\u000a   * set of presentation controllers.\u000a   * TODO: Use FrozenArray once available. (Bug 1236777)\u000a   * readonly attribute FrozenArray<PresentationConnection> connections;\u000a   */\u000a  [Frozen, Cached, Pure]\u000a  readonly attribute sequence<PresentationConnection> connections;\u000a\u000a  /*\u000a   * It is called when an incoming connection is connected.\u000a   */\u000a  attribute EventHandler onconnectionavailable;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationReceiver.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationReceiver.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationreceiver\u000a */\u000a\u000a[Pref=\"dom.presentation.receiver.enabled\"]\u000ainterface PresentationReceiver {\u000a  /*\u000a   * Get a list which contains all connected presentation connections\u000a   * in a receiving browsing context.\u000a   */\u000a  [Throws]\u000a  readonly attribute Promise<PresentationConnectionList> connectionList;\u000a};\u000a"}));
put(foam.json.parse({class:"org.chromium.webidl.IDLFileContents",id:["https://github.com/mozilla/gecko-dev.git","382a7d90d633c59918d597192537443d8e1def0b","dom/webidl/PresentationRequest.webidl"],metadata:{class:"org.chromium.webidl.GithubIDLFile",githubBaseURL:"https://github.com/mozilla/gecko-dev",repository:"https://github.com/mozilla/gecko-dev.git",revision:"382a7d90d633c59918d597192537443d8e1def0b",path:"dom/webidl/PresentationRequest.webidl"},contents:"/* -*- Mode: IDL; tab-width: 2; indent-tabs-mode: nil; c-basic-offset: 2 -*- */\u000a/* This Source Code Form is subject to the terms of the Mozilla Public\u000a * License, v. 2.0. If a copy of the MPL was not distributed with this file,\u000a * You can obtain one at http://mozilla.org/MPL/2.0/.\u000a *\u000a * The origin of this IDL file is\u000a * https://w3c.github.io/presentation-api/#interface-presentationrequest\u000a */\u000a\u000a[Constructor(DOMString url),\u000a Constructor(sequence<DOMString> urls),\u000a Pref=\"dom.presentation.controller.enabled\"]\u000ainterface PresentationRequest : EventTarget {\u000a  /*\u000a   * A requesting page use start() to start a new connection, and it will be\u000a   * returned with the promise. UA may show a prompt box with a list of\u000a   * available devices and ask the user to grant permission, choose a device, or\u000a   * cancel the operation.\u000a   *\u000a   * The promise is resolved when the presenting page is successfully loaded and\u000a   * the communication channel is established, i.e., the connection state is\u000a   * \"connected\".\u000a   *\u000a   * The promise may be rejected duo to one of the following reasons:\u000a   * - \"OperationError\": Unexpected error occurs.\u000a   * - \"NotFoundError\":  No available device.\u000a   * - \"AbortError\":     User dismiss/cancel the device prompt box.\u000a   * - \"NetworkError\":   Failed to establish the control channel or data channel.\u000a   * - \"TimeoutError\":   Presenting page takes too long to load.\u000a   * - \"SecurityError\":  This operation is insecure.\u000a   */\u000a  [Throws]\u000a  Promise<PresentationConnection> start();\u000a\u000a  /*\u000a   * A requesting page can use reconnect(presentationId) to reopen a\u000a   * non-terminated presentation connection.\u000a   *\u000a   * The promise is resolved when a new presentation connection is created.\u000a   * The connection state is \"connecting\".\u000a   *\u000a   * The promise may be rejected duo to one of the following reasons:\u000a   * - \"OperationError\": Unexpected error occurs.\u000a   * - \"NotFoundError\":  Can not find a presentation connection with the presentationId.\u000a   * - \"SecurityError\":  This operation is insecure.\u000a   */\u000a  [Throws]\u000a  Promise<PresentationConnection> reconnect(DOMString presentationId);\u000a\u000a /*\u000a  * UA triggers device discovery mechanism periodically and monitor device\u000a  * availability.\u000a  *\u000a  * The promise may be rejected duo to one of the following reasons:\u000a  * - \"NotSupportedError\": Unable to continuously monitor the availability.\u000a  * - \"SecurityError\":  This operation is insecure.\u000a  */\u000a  [Throws]\u000a  Promise<PresentationAvailability> getAvailability();\u000a\u000a  /*\u000a   * It is called when a connection associated with a PresentationRequest is created.\u000a   * The event is fired for all connections that are created for the controller.\u000a   */\u000a  attribute EventHandler onconnectionavailable;\u000a\u000a  /*\u000a   * A chrome page, or page which has presentation-device-manage permissiongs,\u000a   * uses startWithDevice() to start a new connection with specified device,\u000a   * and it will be returned with the promise. UA may show a prompt box with a\u000a   * list of available devices and ask the user to grant permission, choose a\u000a   * device, or cancel the operation.\u000a   *\u000a   * The promise is resolved when the presenting page is successfully loaded and\u000a   * the communication channel is established, i.e., the connection state is\u000a   * \"connected\".\u000a   *\u000a   * The promise may be rejected duo to one of the following reasons:\u000a   * - \"OperationError\": Unexpected error occurs.\u000a   * - \"NotFoundError\":  No available device.\u000a   * - \"NetworkError\":   Failed to establish the control channel or data channel.\u000a   * - \"TimeoutError\":   Presenting page takes too long to load.\u000a   */\u000a  [ChromeOnly, Throws]\u000a  Promise<PresentationConnection> startWithDevice(DOMString deviceId);\u000a};\u000a"}));
